(229, 1838, 1, 'Eastside Stages Studio 1', '2022-02-15 12:53:41', '2022-02-17 04:17:25', 'cc935352-c37c-4db5-a01d-328445c181a2', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>Housed in the Provident Loan Society Bank building this neoclassical gem has been completely gut renovated and boasts a modernized infrastructure. NMPs Eastside Stages features a high-speed fiber trunk, high-efficiency sound dampening HVAC, and triple-glazed acoustic glass fenestrations.</p>\r\n<p>Once you see its soaring two-story high ceilings, the natural light streaming through its nine foot windows, and all that exposed brick you may want to call Eastside Stage 1 your new home. While we cant offer you the space as your next apartment (sorry), wed be happy for you to make Stage 1 the home of all your upcoming productions. See what we did there? With plenty of room for large sets along with access to a connected mezzanine space, the possibilities are endless.<br /></p>\r\n\r\n', '<ul><li>30 x 40 Ground Floor</li><li>30 x 50 Mezzanine Level</li><li>30 Ceiling</li><li>Motorized Grid</li><li>200A 3 Phase Power</li></ul>', 'There are very few vendors I know of that truly put their client needs first and respond with no problem no matter what the request or need. NMP is definitely in this category! ', 'Russell Grant, President Live Shot Media', NULL),
