(232, 1841, 1, 'Eastside Stages Studio 2', '2022-02-15 12:55:38', '2022-02-17 04:17:39', 'cb801862-9cf9-4475-9be5-8ff7de97376c', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>Housed in the Provident Loan Society Bank building this neoclassical gem has been completely gut renovated and boasts a modernized infrastructure. NMPs Eastside Stages features a high-speed fiber trunk, high-efficiency sound dampening HVAC, and triple-glazed acoustic glass fenestrations.<br /><br /></p>\r\n<p>Eastside Stage 2 is ready to roll on your latest SMT or interview shoot. Stage 2s white washed brick and modern set options will help your next hit stand out from the crowd. Not to mention, the lounge is not a bad place to relax and sip on a cup of coffee.<br /></p>\r\n', '<ul><li>25 x 25</li><li>14 Ceiling</li><li>Fixed Grid</li><li>100A 3 Phase Power</li></ul>', 'Beginning with our initial project together in 2008, I have found everyone at NMP to be collaborative, creative and professional.', 'Judy Spier, Director/Producer Judy Spier Productions', NULL),
