(235, 1844, 1, 'Studio A', '2022-02-15 12:59:33', '2022-02-15 12:59:33', '6b99ecde-d1c4-46a2-a8fa-cd0dd303b206', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>The largest of our shooting studios at 31 Howard Street, this studio can accommodate everything from a bedroom to a beach to a mock TV studio to a hospital to a garage to a...well you get the idea. This versatile space is equipped with all the high level tech youd expect along with the comfort and convenience of our spacious green room, private hair &amp; makeup space, and our unmatched client services.</p>', '<ul><li>20\' x 30\' sound stage</li><li>18\' Ceiling (14\' to grid)</li><li>2 Wall cyclorama</li><li>Elevated control room</li><li>200 Amps of distributed power</li><li>Green room</li></ul>', 'The entire crew at NMP is professional and caring. We always receive rave reviews from our clients that visit their unique studio with us and I never hesitate to refer any of my contacts to them!', 'Karl Wayne, Executive Producer News Media Group', NULL),
(236, 1861, 1, 'Home Page', '2022-02-16 00:35:23', '2022-02-16 00:36:58', '4460c345-1861-48d9-b719-90b0c56a78a8', 'Studios | Production | Creative', 'Everything\'s right here, we just need your story', '<p dir=\"ltr\">We help brands and organizations connect with their audience. We help agencies elevate and execute their creative vision. We design and implement production strategies that work. We have been honing our craft for decades. From the Fortune 500 to the local non-profit, we approach every project with the same simple goal...make it absolutely the best it can be.<br /></p>\r\n', 'Whatever your story is, family business, unique service, transforming lives, doing something that has never been done before', 'We want to hear about it...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
